            description: 'ì‚¬ìš©ìì˜ í–‰ë™ ë°ì´í„°ë¥¼ ì‹¤ì‹œê°„ìœ¼ë¡œ ìˆ˜ì§‘í•˜ê³  ë¶„ì„í•˜ì—¬ ê¸‰ë³€í•˜ëŠ” ì‹œì¥ ìƒí™©ê³¼ ì‚¬ìš©ì ë°˜ì‘ì— ì‹ ì†í•˜ê²Œ ëŒ€ì‘í•  ìˆ˜ ìˆìŠµë‹ˆë‹¤.',
            color: '#10b981',
            gradient: 'linear-gradient(135deg, #10b981, #059669)'
          },
          {
            icon: <Users size={32} />,
            title: 'ë…¸ì½”ë“œ ë¶„ì„ í™˜ê²½',
            description: 'ê°œë°œìë‚˜ ë°ì´í„° ë¶„ì„ê°€ì˜ ë„ì›€ ì—†ì´ë„ í˜„ì—… ë‹´ë‹¹ìê°€ ì§ì ‘ ë°ì´í„°ë¥¼ ë¶„ì„í•˜ê³  ì¸ì‚¬ì´íŠ¸ë¥¼ ë„ì¶œí•  ìˆ˜ ìˆìŠµë‹ˆë‹¤.',
            color: '#f59e0b',
            gradient: 'linear-gradient(135deg, #f59e0b, #d97706)'
          }
        ].map((feature, index) => (
          <div key={index} style={{
            background: theme.cardBg,
            borderRadius: '20px',
            padding: '32px',
            border: `1px solid ${theme.cardBorder}`,
            boxShadow: '0 8px 24px rgba(0, 0, 0, 0.2)',
            backdropFilter: 'blur(20px)',
            position: 'relative',
            overflow: 'hidden'
          }}>
            <div style={{
              width: '64px',
              height: '64px',
              background: feature.gradient,
              borderRadius: '16px',
              display: 'flex',
              alignItems: 'center',
              justifyContent: 'center',
              marginBottom: '20px',
              boxShadow: `0 8px 20px ${feature.color}40`
            }}>
              <div style={{ color: 'white' }}>
                {feature.icon}
              </div>
            </div>

            <h3 style={{
              fontSize: '20px',
              fontWeight: '700',
              color: theme.text,
              margin: '0 0 12px 0'
            }}>
              {feature.title}
            </h3>

            <p style={{
              fontSize: '14px',
              color: theme.textSecondary,
              lineHeight: '1.6',
              margin: 0
            }}>
              {feature.description}
            </p>
          </div>
        ))}
      </div>

      {/* í™œìš© ë¶„ì•¼ */}
      <div style={{
        background: theme.cardBg,
        borderRadius: '24px',
        padding: '48px',
        border: `1px solid ${theme.cardBorder}`,
        boxShadow: '0 20px 40px rgba(0, 0, 0, 0.3)',
        backdropFilter: 'blur(20px)'
      }}>
        <h2 style={{
          fontSize: '32px',
          fontWeight: '700',
          color: theme.text,
          margin: '0 0 32px 0',
          textAlign: 'center'
        }}>
          ì£¼ìš” í™œìš© ë¶„ì•¼
