          {[
            {
              title: 'ğŸ® ê²Œì„',
              description: 'ì‚¬ìš©ì ì´íƒˆ ì˜ˆì¸¡ ë° ë°©ì§€, í•µì‹¬ ìœ ë£Œí™” ëª¨ë¸ ê°•í™”, ì½˜í…ì¸  ë° ë°¸ëŸ°ìŠ¤ ì—…ë°ì´íŠ¸ ë°©í–¥ì„± ìˆ˜ë¦½ì„ í†µí•´ ê²Œì„ì˜ ë¼ì´í”„ ì‚¬ì´í´ì„ ì—°ì¥í•˜ê³  ìˆ˜ìµì„±ì„ ê·¹ëŒ€í™”í•©ë‹ˆë‹¤.',
