              description: 'êµ¬ë§¤ ì „í™˜ìœ¨ì´ ë†’ì€ ì‚¬ìš©ìì˜ í–‰ë™ íŒ¨í„´ì„ ë¶„ì„í•˜ì—¬ êµ¬ë§¤ë¥¼ ë§ì„¤ì´ëŠ” ê³ ê°ì—ê²Œ ê°œì¸í™”ëœ ì¶”ì²œ ë° í”„ë¡œëª¨ì…˜ì„ ì œê³µí•¨ìœ¼ë¡œì¨ ë§¤ì¶œ ì¦ëŒ€ë¥¼ ê¾€í•  ìˆ˜ ìˆìŠµë‹ˆë‹¤.',
              example: 'ê°œì¸í™” ì¶”ì²œì„ í†µí•œ ì „í™˜ìœ¨ í–¥ìƒ'
            },
            {
              title: 'ğŸ“º ë¯¸ë””ì–´',
              description: 'ì‚¬ìš©ìì˜ ì½˜í…ì¸  ì†Œë¹„ íŒ¨í„´, ì‹œì²­ ì‹œê°„, ì´íƒˆ ì§€ì  ë“±ì„ ë¶„ì„í•˜ì—¬ ê°œì¸í™”ëœ ì½˜í…ì¸ ë¥¼ ì¶”ì²œí•˜ê³  ì‚¬ìš©ìì˜ ëª°ì…ë„ì™€ ë§Œì¡±ë„ë¥¼ ë†’ì¼ ìˆ˜ ìˆìŠµë‹ˆë‹¤.',
              example: 'ë§ì¶¤í˜• ì½˜í…ì¸  ì¶”ì²œ ì‹œìŠ¤í…œ'
            }
          ].map((field, index) => (
