    // ìƒ˜í”Œ ì´ë²¤íŠ¸ íƒ€ì…
    const eventTypes = [
      { name: 'purchase', label: 'ê²°ì œ', properties: ['amount', 'item_id', 'currency'] },
      { name: 'login', label: 'ë¡œê·¸ì¸', properties: ['login_type', 'device_type'] },
      { name: 'level_up', label: 'ë ˆë²¨ì—…', properties: ['from_level', 'to_level', 'experience'] },
      { name: 'item_use', label: 'ì•„ì´í…œ ì‚¬ìš©', properties: ['item_id', 'quantity', 'result'] },
