    // ëœë¤ ë°ì´í„° ìƒì„± í•¨ìˆ˜ë“¤
    const generateRandomEvent = () => {
      const user = sampleUsers[Math.floor(Math.random() * sampleUsers.length)];
      const eventType = eventTypes[Math.floor(Math.random() * eventTypes.length)];
      const timestamp = new Date();

      let properties: any = {};

      switch (eventType.name) {
        case 'purchase':
          properties = {
            amount: Math.floor(Math.random() * 50000) + 1000,
            item_id: `item_${Math.floor(Math.random() * 100) + 1}`,
            currency: 'KRW'
          };
          break;
        case 'login':
          properties = {
            login_type: Math.random() > 0.5 ? 'auto' : 'manual',
            device_type: Math.random() > 0.5 ? 'mobile' : 'pc'
          };
          break;
        case 'level_up':
          properties = {
            from_level: user.level,
            to_level: user.level + 1,
            experience: Math.floor(Math.random() * 1000) + 500
          };
          break;
        case 'item_use':
          properties = {
            item_id: `item_${Math.floor(Math.random() * 50) + 1}`,
            quantity: Math.floor(Math.random() * 5) + 1,
            result: Math.random() > 0.3 ? 'success' : 'failed'
          };
          break;
        case 'battle_start':
          properties = {
            battle_type: Math.random() > 0.5 ? 'pvp' : 'pve',
            opponent_level: Math.floor(Math.random() * 50) + 1
          };
          break;
